@socketio.on('facecode')
def getcodes(data):
    print(data)
    print(wslist)
    code = secrets.token_hex(20)
    info = str(r.get(data['checkid']))
    print(type(info))
    if info:
        infos = json.loads(info)
        num = ''
        if infos['type'] == 2:
            num = ''.join(random.sample(string.digits, 6))
            infos['num'] = num
        while r.set("fcode_" + code, json.dumps(infos), ex=300, nx=True) is None:
            code = secrets.token_hex(20)
        emit("codechange", {"code": code, "num": num}, room=wslist[data['cid']])
    else:
        emit("codeerror", room=wslist[data['cid']])


