@app.route('/casLogin')
def cas_login():
    token = request.args.get("token")
    if (token == "" or token is None):
        return 'error', 400
    xmlc = requests.get(
        f"https://cas.upc.edu.cn/cas/serviceValidate?ticket={token}&service=https://saltedfish.fun/cas.php").content
    xml = etree.XML(xmlc)
    print(xmlc)
    try:
        uid = xml.find(".//{http://www.yale.edu/tp/cas}user").text
        if uid is None:
            return jsonify({"code": -1})
        user = list(mongo.db.user.find({'ID': uid}, {"_id": 0, "PassWd": 0}))
        print(user, uid)
        if len(user) != 0:
            user = user[0]
            access_token = create_access_token(identity={'ID': user['ID'], 'role': user['role'], 'name': user['name']})
            user['refresh_token'] = create_refresh_token(
                identity={'ID': user['ID'], 'role': user['role'], 'name': user['name']})
            user['access_token'] = access_token
            return jsonify({"code": 0, "data": user})
        else:
            return jsonify({"code": -1})
    except Exception as  e:
        print(e)
        return jsonify({"code": -1})


