@app.route("/checkin", methods=['POST'])
def checkincode():
    try:
        content = request.json
        code = content['code']
        type = content['type']
        ble = str(content['ble'])
        print(content)
        info = json.loads(str(r.get("fcode_" + code)))

        uid = content['uid']
        if r.sismember("fset_" + info['checkid'], uid):
            return json.dumps({"code": 0})
        if info:
            if type == info['type']:
                if len(ble) > 0 and ble != "null" and ":" in ble:
                    bleinfo = ble.split('-')
                    infostr = r.get("b-" + bleinfo[0])
                    if infostr is None:
                        return json.dumps({"code": -1})
                    if infostr != bleinfo[1]:
                        return json.dumps({"code": -1})
                if type == 1:
                    info['uid'] = uid
                    info['checktime'] = int(time.time())
                    if r.sadd("fset_" + code, content['uid']) == 1:
                        mongo.db.checkin.insert_one(info)
                        mongo.db.checkinr.update_one({"_id": ObjectId(info['checkid'])},
                                                     {"$push": {"list": uid}, "$inc": {"num": 1}})
                        socketio.emit('number', {"ID": content['uid'], "name": content['name']}, )
                    return json.dumps({"code": 0})
                elif type == 2:
                    if info['num'] == content['num']:
                        info['uid'] = uid
                        info['checktime'] = int(time.time())
                        if r.sadd("fset_" + code, content['uid']) == 1:
                            mongo.db.checkin.insert_one(info)
                            mongo.db.checkinr.update_one({"_id": ObjectId(info['checkid'])},
                                                         {"$push": {"list": uid}, "$inc": {"num": 1}})
                            socketio.emit('number', {"ID": content['uid'], "name": content['name']}, )
                        return json.dumps({"code": 0})

                    else:
                        return json.dumps({"code": -1})
                elif type == 3:
                    return json.dumps({"code": -1})
            else:
                return json.dumps({"code": -1})
        else:
            return json.dumps({"code": -1})
    except Exception as e:
        print(e)
        traceback.print_exc()
        return json.dumps({"code": -1})


